package day3_Assignment;

public class Swap_two_num {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=20;
		System.out.println("Before Swapping a= "+a+",b= "+b);
		
		int temp=a;
		a=b;
		b=temp;
		
		System.out.println("After Swapping a= "+a+",b= "+b);
		

	}

}
